import imageFiv from "./../../artFoto/artFiv.jpg";
import imageSix from "./../../artFoto/artSix.jpg";


const fotos = props => {
    var one = imageOne;
    var two = imageTwo;
    var tre = imageTre;

    var index;


    let fotoClasses= 'foto-drawer';
    if(props.show) {
        fotoClasses= 'foto-drawer open';
    }if(props.img === 0 ) {
        index = one;
    }if(props.img === 1) {
        index = two;
    }if(props.img === 1) {
        index = tre;
    }
    return(

            <nav className={fotoClasses} >
                <div className="fotogrid">
                    <img src={ index } alt="importImage"  ></ img>
                </div>
            </ nav>

    );
};


export default fotos;
